import React from 'react';

const Experience = () => {
    return (
        <div className="experience">
            <h3>Expériences</h3>
            <div className='exp-1'>
                <h4>développeur web</h4>
                <h5>2022</h5>
                <p>Formation à distance "Développeur web" chez Openclassrooms.</p>
            </div>
            <div className="exp-2">
                <h4>conducteur receveur bus/tramway</h4>
                <h5>Depuis 2007</h5>
                <p>Polyvalence conduite bus et tramway.</p>
            </div>
            <div className="exp-3">
                <h4>électricien d'équipements</h4>
                <h5>2005</h5>
                <p>Polyvalence conduite bus et tramway.</p>
            </div>
        </div>
    );
};

export default Experience;
